sources.components\\Header.scss:
.Header {
  width: 100%;
  height: 50px;
  position: absolute;

  #Nav {
    display: flex;
    justify-content: flex-end;
  }

  #Btn-mobile {
    margin: 7px;
  }

  &-menu {

    a {
      color: #fff;
      text-decoration: none;

    }
  }



  @media (max-width: 2000px) {
    &-menu {
      position: absolute;
      width: 100%;
      background: $Blue-color;
      text-align: center;
      height: 0px;
      transition: .6s;
      z-index: 1000;
      visibility: hidden;
      overflow-y: hidden;

      li {
        margin-top: 100px;
      }

      a {
        font-size: 30px;
        border-bottom: 2px solid #fff;

      }
    }

    #Nav.active &-menu {
      height: 100vh;
      visibility: visible;

    }

    #Btn-mobile {
      display: flex;
      padding: 8px 13px;
      font-size: 18px;
      border: none;
      background: none;
      cursor: pointer;
      gap: 5px;
      z-index: 1001;
    }

    #Hamburguer {
      display: block;
      color: #fff;
      width: 20px;
      border-top: 2px solid;

      &::after,
      &::before {
        content: '';
        display: block;
        width: 20px;
        height: 2px;
        background: blue;
        margin-top: 5px;
        background: currentColor;
        transition: .3s;
        position: relative;
      }
    }

    #Nav.active #Hamburguer {
      border-top-color: transparent;

      &::before {
        transform: rotate(135deg);
      }

      &::after {
        transform: rotate(-135deg);
        top: -7px;

      }
    }
  }
}

sources.components\\Banner.scss:
.Banner {
  height: 100%;
  width: 100%;

  &-text {
    position: absolute;
    color: #fff;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    gap: 40px;

    width: 100%;
    height: 284px;
    top: 264px;

    h1 {
      text-transform: uppercase;
      letter-spacing: 10px;
      font-weight: 700;
      font-size: 48px;
      text-align: center;
      line-height: 56px;
    }

    h2 {
      font-size: 32px;
      text-align: center;
      font-weight: 700;
      line-height: 40px;
    }

    button {
      display: flex;
      flex-direction: row;
      justify-content: center;
      align-items: center;
      padding: 12px 16px;
      gap: 4px;

      width: 197px;
      height: 44px;

      background: $Red-color;
      border-radius: 40px;
      border: none;

      flex: none;
      order: 0;
      flex-wrap: 0;

      color: #fff;
      text-transform: capitalize;
      font-weight: 700;
      font-size: 14px;
      line-height: 20px;
    }
  }

}

