sources.components\\swiper.scss:
.swiper {
  position: relative;
  top: 630px;
  left: 10px;


  &-text {
    margin-bottom: 25px;
    font-size: 20px;
    font-weight: 700;
  }

  &-wrap {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
  }

  img {
    max-width: 300px;

  }

  &-pagination {
    bottom: 110px !important;
    left: 165px !important;

    &-bullet {
      width: 10px !important;
      height: 10px !important;
      background: #fff !important;
    }

  }
}
